import React from 'react';

export default class Home extends React.Component {

    render(){
        return(
            <div>
                <h1>Home</h1>
                <h2>Compile your list of future reads and movies!</h2>
                <p>Pick one of the search options above to search the NYT directory and add items to your list.</p>
                <p>Happy searching!</p>
            </div>
        )
    }
}
